import React from 'react';
import './index.css';

const Jobs = (props) => {
  const { allJobs } = props; // Extract allJobs correctly
  const { title, company, salary, location, description } = allJobs; // Destructure allJobs

  console.log("Received Job:", allJobs); // Debugging line

  return (
    <div className="jobs-container">
      <h1 className="jobs-header">Available Job Listings</h1>
      <div className="jobs-list">
        <div className="job-card">
          <div className="job-header">
            <h2 className="job-title">{title}</h2>
            <span className="job-salary">{salary}</span>
          </div>
          <h3 className="job-company">{company}</h3>
          <div className="job-meta">
            <span className="job-location">üìç {location}</span>
          </div>
          <p className="job-description">{description}</p>
          <button className="apply-button">Apply Now</button>
        </div>
      </div>
    </div>
  );
};

export default Jobs;
